import { useQuery } from "@tanstack/react-query";
import { useParams } from "react-router-dom";
import axios from "axios";

const ListPage = () => {
  const { name } = useParams();

  const { data, isLoading, error } = useQuery({
    queryKey: ["list", name],
    queryFn: async () => {
      if (!name) return null; // name bo'lmasa query ishlamasin
      const res = await axios.get(
        `http://localhost:3000/api/boards?name=${name}`
      );
      return res.data; // faqat kerakli data qaytariladi
    },
    enabled: !!name, // faqat name mavjud bo'lsa fetch qiladi
    onSuccess: (data) => {
      console.log("List data fetched successfully:", data);
    },
  });

  if (isLoading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.message}</div>;
  if (!data) return <div>No data found</div>;

  return (
    <div>
      <h1>Board Name: {name}</h1>
      <pre>{JSON.stringify(data, null, 2)}</pre>
    </div>
  );
};

export default ListPage;

